  return (
    <div className="App">
      <BigDiv>
        <Right />
        <div className="sectionDiv">
          <h1>Lorem ipsum</h1>
          <Section title="titre 1">
          <Circle />
          </Section>
        </div>
        <Left />
      </BigDiv>
    </div>
  );
}

export default App;
